import './App.css';

function App() {
  return (
    <div className="App">
      <User name="Adrian" age={20} email="adrian@adrian.com"/>
      <User name="Mateusz" age={35} email="mateusz@mateusz.com"/>
      <User name="Janusz" age={47} email="janusz@janusz.com"/>
    </div>
  );
}
const User = (props) => {
  return(
    <div className="ViewCard">
      <h1>{props.name}</h1> <br/>
      <h2>{props.age}</h2> <br/>
      <h2>{props.email}</h2>    
    </div>
  );
}
export default App;
